import React from 'react';
import './footer.css';
import { Container,Row,Col,ListGroup,ListGroupItem } from 'reactstrap';
// import {BsFillLuggageFill} from 'react-icons/bs';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/yayin.png';

const quick__links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  }
];

const quick__links2=[
  {
    path:'/gallery',
    display:'Gallery'
  },
  {
    path:'/login',
    display:'Login'
  },
  {
    path:'/signup',
    display:'Register'
  }
]

const Footer=()=> {

  const year=new Date().getFullYear();

  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg='3'>
            <div className="logo">
              <img src={logo} alt="" />
              {/* <h1 className='flex' style={{color:'orange', textDecoration:'bold'}}><b>Yay<BsFillLuggageFill className="icon"/>IN</b></h1> */}
              <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Nam placeat at mollitia facilis inventore aliquid exercitationem beatae sequi, officia saepe distinctio rerum nobis nemo voluptates eum perferendis dicta vitae labore?</p>

              <div className="social__links d-flex align-items-center gap-4">
                <span><Link to='#'><i class='ri-youtube-line'></i></Link></span>
                <span><Link to='#'><i class='ri-facebook-circle-line'></i></Link></span>
                <span><a href='https://www.instagram.com/natureworld247365/'><i class='ri-instagram-line'></i></a></span>
                <span><Link to='#'><i class='ri-whatsapp-line'></i></Link></span>
              </div>
            </div>
          </Col>
          <Col lg='3'>
            <h5 className='footer__link-title'>Discover</h5>

            <ListGroup className='footer__quick-links'>{
              quick__links.map((item,index)=>(
                <ListGroupItem key={index} className='ps-0 border-0'>
                  <Link to={item.path}>{item.display}</Link>
                </ListGroupItem>
              ))
            }</ListGroup>
          </Col>
          <Col lg='3'><h5 className='footer__link-title'>Quick Links</h5>

<ListGroup className='footer__quick-links'>{
  quick__links2.map((item,index)=>(
    <ListGroupItem key={index} className='ps-0 border-0'>
      <Link to={item.path}>{item.display}</Link>
    </ListGroupItem>
  ))
}</ListGroup></Col>
          <Col lg='3'>
          <h5 className='footer__link-title'>Contact</h5>

<ListGroup className='footer__quicks-links'>
    <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
      <h6 className='mb-0 d-flex align-items-center gap-2'><span><i class='ri-map-pin-line'></i></span>
      Address:</h6>
      <p className='mb-0'>Hyderabad, India</p>
    </ListGroupItem>
    <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
      <h6 className='mb-0 d-flex align-items-center gap-2'><span><i class='ri-mail-line'></i></span>
      Email:</h6>
      <p className='mb-0'>chandrasekhar7229313@outlook.com</p>
    </ListGroupItem>
    <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
      <h6 className='mb-0 d-flex align-items-center gap-2'><span><i class='ri-phone-fill'></i></span>
      Phone:</h6>
      <p className='mb-0'>+9170132*****</p>
    </ListGroupItem>
 </ListGroup>
          </Col>
          <Col lg='12' className='text-center pt-5'>
            <p className="copyright"><span><i class='ri-copyright-fill'></i></span>Copyright{year}, Design and Developed by CSS</p>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
